import React from 'react';
import Card from '../Card/Card.js';

const Cards = ({busqueda})=>{

    return (
        <div className="containerCards">
           {
           busqueda.map(element => (
                <Card key={element.id} name={element.name} imagen= {element.background_image} rating={element.rating} genres={element.genres}/>
                                
             ))
                
            }

        </div>
    )
}

export default Cards;
